import React from 'react'

export default function ContactInfo (props) {
    return (
        <div className='contact-info'>
            <img src={props.image} className='contact-info__image' width='100%'  alt='Bilde av Magne Hoftun' />
            <p>{props.name}</p>
            <p>{props.mail}</p>
            <p>{props.phone}</p>
        </div>
    )
}
